// imr
import React from "react";
import {
  Router,
  Routes,
  Route,
  Link,
  RedirectComponent,
} from "react-router-dom";

// import { useState, useEffect } from "react" - imrse;

// Component
import Home from "./components/home/Home";
import SignUp from "./components/account/signUp/SignUp";
import SignIn from "./components/account/signIn/SignIn";
import ResetPass from "./components/account/resetPass/ResetPass";
import ScreenSaver from "./components/screenSaver/ScreenSaver";

// Css
import "./App.css";

function App() {
  return (
    <div
      className="App"
      style={{
        backgroundImage: "url(" + "https://tsks.app/img/signin_balls.png" + ")",
        backgroundColor: "#181820",
      }}
    >
      <Router>
        <nav>
          <ul>
            <li>
              <Link to="/manatee">Manatee</Link>
            </li>
            <li>
              <Link to="/narwhal">Narwhal</Link>
            </li>
            <li>
              <Link to="/whale">Whale</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/manatee">
            <Home />
          </Route>
          <Route path="/narwhal">
            <ScreenSaver />
          </Route>
          <Route path="/whale">
            <SignUp />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}
export default App;
